// 定义 JSON Schema
const schema = {
    "$schema": "https://json-schema.org/draft/2020-12/schema",
    "$id": "http://example.com/schemas/schema.json",
    "type": "object",
    "properties": {
      "ommatidialProperties": {
        "type": "object",
        "properties" : {
          "foo": {
            "description":"3D Vector",
            "type":"array",
            "items": {"type" : "number"},
            "minItems": 3,
            "maxItems": 3
          },
          "creationDatetime": {
            "description": "The date and time when the file was created.",
            "type": "string",
            "format": "date-time"
          },
          "testImage": {
            "description": "To test custom keyword isImage.",
            "type": "string",
            "isImage": true
          }
        },
        "required": ["foo"]
      }
    }
};

const defsSchema = {
  "$id": "http://example.com/schemas/defs.json",
  "definitions": {
    "int": {"type": "integer"},
    "str": {"type": "string"},
  },
};

// create Ajv instance
const Ajv = window.ajv2020;
const ajv = new Ajv({schemas:{
    schema,defsSchema
}});
ajv.addFormat('date-time', {
  type: 'string',
  validate: function(data) {
    // RFC3339 date-time regular expression
    const rfc3339Regex = /^\d{4}-\d{2}-\d{2} \d{2}:\d{2}(?::\d{2}(?:\.\d{1,3})?)?$/;
    return rfc3339Regex.test(data);
  }
});
ajv.addKeyword({
  keyword: "isImage",
  type: "string",
  // 要等待图像验证操作成功后返回验证结果，是个“异步”操作
  validate: async (schema, data) => {
    return new Promise((resolve, reject) => {
      // not image if data is not string type
      if (typeof data != 'string') {
        resolve(false);
      }

      const img = new Image();
      img.src = data; // check if data is valid image URL
      img.onload = () => {
        const width = img.width;
        const height = img.height;
        const isSingleChannel = width * height === data.length; // 1-channel validation
        const isThreeChannel = width * height * 3 === data.length; // 3-channel validation
        if (isSingleChannel || isThreeChannel) {
          resolve(true);
        } else {
          resolve(false);
        }
      };
      img.onerror = () => {
        resolve(false);
      }
    });
  },
  errors: true
});
// 编译 JSON Schema
const validate = ajv.compile(schema);

// 测试数据
const data = {
    "ommatidialProperties": {
      "foo": [0,0,0],
      "creationDatetime" : "2023-08-27 14:32:16.1",
      "testImage" : "data:image/png;base64,"
    }
};

// 验证数据是否符合 JSON Schema
const valid = validate(data);
if (valid) {
    console.log("数据有效");
} else {
    console.log("数据无效");
    console.log(validate.errors);
}